import h from 'src/components/HeaderBlock/style.module.css';

const Header = () => {
  return (
    <>
      <header class="root">
        <div class="forest"></div>
        <div class="container">
        <h1>This is title</h1>
        <p>This is Description!</p>
         </div>
      </header>
    </>
    );
}

export default Header;
